import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS

function Footer() {
  return (
    <footer className="footer py-3 bg-dark text-white mt-5"style={{marginLeft: '300px',marginTop: '700px'}}>
      <div className="container">
        <div className="row">
          <div className="col text-center">
            <p>&copy; 2024 E-Consultation. All rights reserved.</p>
            <p>Trademark E-Consultationâ„¢</p>
          </div>
          <div className="col d-flex justify-content-end">
            <a href="/" className="text-white text-decoration-none mx-1">Home</a>
            <a href="/aboutus" className="text-white text-decoration-none mx-1">About Us</a>
            <a href="/contactus" className="text-white text-decoration-none mx-1">Contact Us</a>
          </div>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
